import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const [message, setMessage] = useState("")

  useEffect(() => {
    fetch("http://localhost:3000/data-scrapper")
      .then((res) => res.json())
      .then((data) => setMessage(data), console.log(data))  
  }, [])

  useEffect(() => {
    console.log(message.result)
  }, [message])

  return (
    <div>
      {message.result.map((img) => {
          <img src={img}></img>
        })
      }
    </div>
  );
}

export default App;
